    "2015-02-04T19:39:07.915411",nt"name": "performance-metrics-family-support-services-youth-services-program-monthly-utilization-61918",nt"isopen":
    false,nt"url": null,nt"notes": "This metric tracks the number of young
    people enrolled in youth services per month. DFSS is committed to creating a premier
    out-of-school time system that provides young people the opportunity to participate
    in high-quality, safe, and structured programs. DFSS funds over 200 Out-of-School
    Time (OST) programs that serve youth between the ages of 6 to 18 years across the
    city of Chicago in five types of programs: Academic/Vocational Support and Enrichment;
    Science, Computer, and Technology; Arts and Culture; Sports, Fitness, Health, and
    Nutrition; and Innovative. Missing: This dataset does not include additional OST
    programs supported by other city agencies such as the Chicago Park District, Chicago
    Public Schools, the Chicago Housing Authority, etc.rnu2022        Academic/Vocational
    Support and Enrichment - academic support, remedial education services, tutoring,
    literacy, and reconnecting youth with other educational opportunitiesrnu2022        Science,
    Computer, and Technology - skills building focused on computer programming, software,
    and technologyrnu2022        Arts and Culture -  promoting excellence in the arts
    through access, awareness  and opportunities for creative expression, increased
    cultural awareness, and demonstrative skills  concluding with an event, play or
    exhibitrnu2022        Sports, Fitness, Health, and Nutrition - opportunities for
    physical activities and education that supports healthy choices and a positive lifestylernu2022
           Innovative u2013 opportunities for youth ages 13 to 15 and 16 to 18 that
    provide customized projects supporting skills building in areas such as  civic engagement,
    entrepreneurship, workforce development, and post-secondary education to prepare
